import React, { Component } from 'react';
import './CalculatePayForm.css';
import TimePicker from 'react-time-picker';
import './node_modules/jquery-timepicker/jquery.timepicker.min.js';
import './jquery-timepicker/jquery.timepicker.min.css';

class CalculatePayForm extends Component {

  render() {
    return (
      <form onSubmit={this.calculatePay()} id="calcPayForm">
        <label>Start Time:
        </label>
        <TimePicker/>
        <br/>
        <br/>
        <label>Bed Time:
        </label>
        <TimePicker/>
        <br/>
        <br/>
        <label>End Time:
        </label>
        <TimePicker/>
        <br/>
        <br/>
        <input type="submit" value="Calculate Pay" id="calcPayButton"/>
      </form>
    )
  }

  calculatePay() {
    return 0;
  }
}

export default CalculatePayForm;
